    path: ./ruleset/filter.txt
    interval: 432000
  blocked-sites:
    behavior: classical
    interval: 432000
    path: ./ruleset/blocked.yaml
    type: http
    url: https://raw.githubusercontent.com/mahanmi/iran-clash-example/main/clash-rules/blocked-sites.yaml
